description:
Bán nhà Cầu Giấy 32m² 6tỷ5 gần Trường Nguyễn Tất Thành vài mét Chợ Xanh  Đường Xuân Thủy, Dịch Vọng Hậu, Cầu Giấy, Hà Nội, với thiết kế 5 tầng hiện đại.

Nhà khung BTCT 5 tầng, chính chủ tự xây, thiết kế đẹp, gồm:
- 3 phòng ngủ rộng rãi, đầy đủ ánh sáng tự nhiên.
- 3 toilet tiện nghi, đảm bảo sự riêng tư cho cả gia đình.
- Phòng khách, phòng ăn + bếp; phòng thờ; thư viện; sân phơi; tiểu cảnh.
- Mặt tiền 4,6m, sâu 12,5m;
- Nội thất đầy đủ.
- Nhà có GPXD, sổ hồng chính chủ; pháp lý đầy đủ.

Ưu điểm:
- Trên trục đường chính Xuân Thuỷ - Cầu Giấy nên đi lại thuận tiện;
- Không gian ở yên tĩnh, khu đất cao không bị ngập lụt;
- Mặt tiền rộng, phong thủy tốt, mang lại tài lộc cho gia chủ;
- Pháp lý đầy đủ, an tâm khi giao dịch.

Tiện ích xung quanh:
- Đối diện là Học viện Báo chí, Trường ĐHQG, ĐHSP Hà Nội, AEON Xuân Thuỷ;
- Cạnh siêu thị điện máy Pico 173 Xuân Thủy, Siêu thị WinMart;
- Gần nhiều trường phổ thông, các bệnh viện lớn (Viện E, Viện 19-8, Viện GTVT), công viên Cầu Giấy, công viên Nghĩa Đô.
Giá bán 6.5 tỷ.
